import Head from "next/head";
import React from "react";
import Layout from "../components/layout";

const Index = () => {
  return (
    <div>
      <Head>
        <title>Index</title>
      </Head>
      <Layout>
        <h1>Index page</h1>
      </Layout>
    </div>
  );
};

export default Index;
